import React from 'react'
import { connect } from 'react-redux'


import { EditTodo, AddTodo, DeleteTodo } from '../../Actions/todo'
import List from './testList'

function mapDispatchToProps(dispatch) {
  return {
    AddTodo: item => dispatch(AddTodo(item))
  };
}

class TestForm extends React.Component {
  handleAdd = () => {
    this.props.AddTodo({ id: 2, content: "this content from test.js" })
  }
  render() {
    return (
      <div >
        <div>
          <button onClick={this.handleAdd}>Add</button>
        </div>
      </div>
    )
  }
}

// const Test = connect(null, AddTodo)(TestForm)

export default connect(mapDispatchToProps, AddTodo)(TestForm);
